sys_variable_value.value:
(function execute(inputs, outputs) {
  var attachment = inputs.attachment;

  var ga = new GlideSysAttachment();
  var base64 = ga.getContentBase64(attachment);
  outputs.base64 = base64;

})(inputs, outputs);

